import React from 'react';
import {Row,col,Container} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function Head(){
    return(
        <Container>
            <Row>
                <Col>1 of 2</Col>
                <Col>2 of 2</Col>
            </Row>
        </Container>
    )
}
export default Head;
